    "2016-07-27T22:45:05.691740",nt"name": "a-narrative-report-september-october-november-and-december-1956-chautauqua-national-wildli",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Chautauqua NWR
    outlines Refuge accomplishments from September through December of 1956. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
    mammals, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. Resource management is outlined;
    topics include commercial fishing. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, fishing, and
    violations. N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
